import React, {Fragment} from 'react';
import { Table } from 'react-bootstrap';
import { PDFViewer, PDFDownloadLink, Page, Text, View, Document, StyleSheet } from '@react-pdf/renderer';

// Create styles
const styles = StyleSheet.create({
  document: {
    width: '100%',
    height: '100% !important'
  },  
  page: {
    flexDirection: 'row',
    backgroundColor: '#FFFFFF',
    width: '100%',
    height: '100% !important'
  },
  section: {
    width: 200,
    '@media max-width: 400': {
      width: 300,
    },
    '@media orientation: landscape': {
      width: 400,
    },
    height: 100,
    margin: 10,
    padding: 10,
    flexGrow: 1
  }
 
});

const Report = (props) => {
      
  
  let totalExportacoes = props.data.movimentacoes ? props.data.movimentacoes.totalExportacao : 0
  let totalImportacoes = props.data.movimentacoes ? props.data.movimentacoes.totalImportacao : 0
  var rows = props.data.movimentacoes ? props.data.movimentacoes.movimentacoes.map((m, index) => {
    
    return m.map((mov,i) => {

     
      return  <View key={i}>
                <Text>{mov.conteiner.cliente.nome}</Text>
                <Text>{mov.conteiner.numero}</Text>
                <Text>{mov.tipoMovimentacao.descricao}</Text>
                <Text>{mov.conteiner.categoria.descricao}</Text>
                <Text>{mov.dataHoraInicio}</Text>
                <Text>{mov.dataHoraFim}</Text>
              </View>
    })

  }) : []

  return (
    <div>
     <PDFViewer style={styles.document} height={745} >
            <Document >
          <Page size="A4" style={styles.page}>
            <View style={styles.section}>
              <Text>T2S - Movimentações</Text>
            </View>   
            <View style={styles.section}>            
               <Fragment>
                 {rows}
               </Fragment>                          
            </View>   
           <View style={styles.section}>
              <Text>Total de Exportações: {totalExportacoes}</Text>         
              <Text>Total de Importações: {totalImportacoes}</Text>
           </View>                              
          </Page>
        </Document>
      </PDFViewer>                                                                               
    </div>
    )            
}

export default Report
